import React from 'react'
import './Order.css'

const order = (props) => {
    return(
        <div className="order">
            <h3>Helen Gentry</h3>
            <p>helengentry@kyaguru.com</p>
            <p>Product 2 : 4 Qty</p>
        </div>
    )
}

export default order
